import React from 'react';

const HelpPage = () => {
    return (
        <div className="container mx-auto p-4">
            <h1 className="text-2xl font-bold">Help & Support</h1>
            <p>How to use AgriGuard.</p>
        </div>
    );
};

export default HelpPage;
